import React, { useContext } from 'react'
import "./hotel.css"
import Navbar from "../../../Components/navbar/Navbar"
import Header from "../../../Components/navbar/header/Header"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCircleArrowLeft, faCircleArrowRight, faCircleXmark, faLocationDot } from '@fortawesome/free-solid-svg-icons'
import MailList from '../../../Components/mailList/MailList'
import Footer from '../../../Components/footer/Footer'
import { useState } from "react"; 
import { useLocation } from 'react-router-dom'
import useFetch from '../../../hooks/useFetch'
import { SearchContext } from '../../../context/SearchContex'


export default function Hotel() { 
  const location = useLocation() 
  const id = location.pathname.split("/")[2];

  console.log(location);

  const [slideNumber , setSlideNumber]= useState(0);
  const [open , setOpen]= useState(false);

  const{data, loading, error, reFetch} = useFetch(`/hotels/find/${id}`)

  const {dates} = useContext(SearchContext)
  // const {dates} = useContext(SearchContext)
  console.log(dates);

  const photos =[
  {
    src:"data:image/jpeg;base64,"

  },
  {
    src:"data:image/jpeg;base64,"
  },
  {
    src:"data:image/jpeg;base64,"
  },
  {
    src:"data:image/jpeg;base64,"
  },
  {
    src:"data:image/jpeg;base64,"
  },
  {
    src:"data:image/jpeg;base64,"
  },
  ];

  const handleOpen=(i)=>{
     setSlideNumber(i);
     setOpen(true);
  }
  const handelMove = (direction)=>{
   let newSlideNumber;

   if(direction === "l"){
    newSlideNumber= slideNumber === 0 ? 5: slideNumber-1
   }else{
    newSlideNumber= slideNumber === 5 ? 0: slideNumber+1
   }
   setSlideNumber(newSlideNumber);
  };
  return (
    <div>
      <Navbar />
      <Header type="list"/>
      {loading ? "loading...." : (<div className="hotelContainer">
        {open && <div className="slider">
          <FontAwesomeIcon icon={faCircleXmark} className='close' onClick={()=> setOpen(false)}/>
          <FontAwesomeIcon icon={faCircleArrowLeft} className='arrow' onClick={()=> handelMove("l")}/>
          <div className="sliderWrapper">
            <img src={data.photos[slideNumber]} alt="" className="sliderImg" />
          </div>
          <FontAwesomeIcon icon={faCircleArrowRight} className='arrow' onClick={()=> handelMove("r")}/>
          </div>}
        <div className="hotelWrapper">
          <button className='bookNow'>Reserve or Book now!</button>
          <h1 className="hotelTitle">{data.name}</h1>
        <div className="hotelAddress">
          <FontAwesomeIcon icon={faLocationDot} />
          <span>{data.address}</span>
        </div>
        <span className="hotelDistance">Excellent location - {data.distance}m from center</span>
        <span className="hotelPriceHighlight">book a stay over {data.cheapestPrice} at this property and get a free airport taxi</span>
        <div className="hotelImage">
            {data.photos?.map((photo,i) =>(
              <div className="hotelImgWrapper">
                <img onClick={()=>handleOpen(i)} src={photo} alt="" className="hotelImg" />
              </div>
            )) }
        </div>
        <div className="hotelDetails">
        <div className="hotelDetailsTaxts">
          <h1 className="hotelTitle">{data.title}</h1>
          <p className="hotelDesc">{data.desc}</p>
        </div>
        <div className="hotelDetailsprice">
          <h2>Perfect for a 9-night stay</h2>
          <span> Located in the real heart of Krakow, this property has an
                excellent location score of 9.8!</span>
                <h3>
                <b>$945</b> (9 nights)
              </h3>
          <button>Reserve or book now!</button>
        </div>
        </div>
        </div>
        <MailList />
        <Footer />
      </div>)}
    </div>
  )
}
